import React from 'react';
import {Link } from 'react-router-dom';




const NavComponent = () => {
return (
<nav className="nav-wrapper">

        <div className="container">

            <ul>
            <li><Link to="/home" className="brand-logo left" >Home</Link></li>
            </ul>
            <ul className="right">
            <li><Link to="/" >Healing Circle</Link></li>
            <li><Link to="/create" >Heal Request</Link></li>
            <li><Link to="/user" >Create Healer</Link></li>

            <li><Link to="/instructions" >Instructions</Link></li>
           {/*
            <li><Link to="/healrequestform" >Heal Request</Link></li>
            <li><Link to="/circle" >Healing Circle</Link></li>


            <li><Link to="/createaccount" >Login</Link></li>
            */}

            </ul>
        </div>

</nav>
);

};

export default NavComponent;
